using namespace std;

class Solution {
public:
    string reverseWords(string s) {
        vector<string> words;
        for (auto c : s) {
            if (isalpha(c)) {
                words.push_back(string(1, c));
            }
        }
        reverse(words.begin(), words.end());
        string ret = "";
        for (auto w : words) {
            ret += w;
        }
        return ret;
    }
};

int main() {
    Solution sol;
    string s = "cool  dog";
    reverseWords(s);
    cout << s << endl;
    return 0;
}

