Npc::Npc()
{
	m_npc_id = 0;
	m_npc_name = L"";
	m_npc_image = 0;
}

Npc::~Npc()
{
}

bool Npc::Load(LPSTR file_name)
{
	if (!LoadFromFile(file_name))
		return false;

	return true;
}

bool Npc::Save(LPSTR file_name)
{
	if (!SaveToFile(file_name))
		return false;

	return true;
}

bool Npc::LoadFromFile(LPSTR file_name)
{
	FILE *file = fopen(file_name, "rb");
	if (!file)
		return false;

	fread(&m_npc_id, sizeof(m_npc_id), 1, file);
	fread(&m_npc_name, sizeof(m_npc_name), 1, file);
	fread(&m_npc_image, sizeof(m_npc_image), 1, file);

	fclose(file);

	return true;
}

bool Npc::SaveToFile(LPSTR file_name)
{
	FILE *file = fopen(file_name, "wb");
	if (!file)
		return false;

	fwrite(&m_npc_id, sizeof(m_npc_id), 1, file);
	fwrite(&m_npc_name, sizeof(m_npc_name), 1, file);
	fwrite(&m_npc_image, sizeof(m_npc_image), 1, file);

	fclose(file);

	return true;
}

